const Completed = ({ finalData, MissileImage }) => {
  const modals = useModals();
  const { playerCreationState, uiEventHandlers } = useContext(Context);

  useEffect(() => {
    if (finalData) {
      uiEventHandlers.playerCreation(finalData);
    } else {
      modals.openContextModal('error', {
        title: 'Critical Error',
        innerProps: {
          errorMessage:
            'No final data was provided to the component which sends the PlayerCreation data to the server. Shame on you.',
        },
      });
    }
  }, []);

  return (
    <>
      <h3>Preparing your account</h3>
      <div className={styles.sendingToServer}>
        <img className={styles.missileImage} src={MissileImage} alt='' />
        <Text>Status: {playerCreationState}</Text>
      </div>
    </>
  );
};

export default Completed;
